import React from "react";
import {Link} from 'react-scroll';

const NavBar=()=>{
    return(
        <>
        <nav>
        <h3>Knowledge Hive</h3>
        <div className="desktopMenu">
          <Link activeClass='active' to='about' spy={true} smooth={true} offset={-100} duration={500} className="desktopMenuListItem">About</Link>
          <Link activeClass='active' to='' spy={true} smooth={true} offset={-50} duration={500} className="desktopMenuListItem">Features</Link>
          <Link activeClass='active' to='works' spy={true} smooth={true} offset={-50} duration={500} className="desktopMenuListItem">Contact</Link>
        </div>
        </nav>
        </>
    )
}
export default NavBar;
